import React, { useEffect } from "react";

const Score = (props: {score: number}) => {
    useEffect(() => {
        props.score
    })
    return (
        <div className="score-box">
            <div className="score-wrap">
                <p className="score-text">Score :</p>
                <p className="count-score">{`${props.score}`}</p>
            </div>
        </div>
    )
}

export default Score;
